  "text" : "(cont.)しかしそれよりも怖いのは、そういう人の悪いところを見つけては、大騒ぎし、そしてそれに同調する群衆です。彼らは、自分達が正しいということを盾に、何をしても何も感じず、周囲に悪を撒き散らす。もちろん、そんなことに彼らは気付いていない。そういう人達が、一番こわいです。",
