  "id_str" : "104927056030220288",
  "text" : "反証可能性の話だって、「そういうものしか扱わない」って決めただけの話であって、反証可能性が正しい間違ってるって話は、議論しても結論でない・・・ことはないかもしれませんが、相当に困難なことですし。 [n]",
