  "text" : "「自分の子どもに人を殺してはいけない理由をはっきりと明言できるような親にはなりたくない」には賛同できるけど、それは「考え方は一つではなく、自分なりに答えを見つけるべき」だと教えるものだと思っているからで、世の理の論理性を否定するなんてことは絶対にしない。 [n]",
