  "geo" : {
  },
  "id_str" : "100979594701705216",
  "text" : "『Appreciation』についてもうちょっと言うと、確かに今回のあれこれで「失敗ばかりを攻撃して、成功をちゃんと評価してない」とは思う。だから、感謝も足りてないかもしれない。そういう点ではこの歌には共感できなくない部分もある。 #槇原敬之",
  "id" : 100979594701705216,
