  "geo" : {
  },
  "id_str" : "98458433803657217",
  "text" : "こういうめんどくささがあるから、ウィキペディア（百科事典）じゃなくて、ウィキブックス（教科書）にしようか、とか、[[開水路]]みたいに最初から最後まで全部1つの記事にしておこうか、とかなるんですよねぇ。 #jawp #jawb [n]",
