  "text" : "何かを解いたり創りだす（プログラミングする、論文を書く、発表スライド資料を作る）のは眠気にあまり影響されず長時間作業が可能だけど、何を理解する（論文・専門書を読む）のは、ちょっとでも眠いと途端に効率悪くなるnegative exponentialのオーダーで。",
  "id" : 98066177821126656,
