  "text" : "「机の上には筆箱を置かない」「落ちても拾わず先生を呼ぶ」とか、中学校まででしたね。いや以降も一応あるにはあるんですが、もう先生も学生も「そこまでしんでもいいよ」っていう雰囲気で。 [l]",
