  "text" : "実際に、「水って0℃ぴったりで氷になるし100℃ぴったりで沸騰するんだからすごいよね！」って言い出した女の子なら知ってる。水理学が専門って言った時の反応で、まぁ無理に褒めようとしてくれたんだろうけど・・・あの時は言葉も出なかった。そもそも水理学は水の流れの話だし。 [n]",
